import { useState, useEffect } from "react";
import {
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from "@mui/material";
import { BiSkipNext } from "react-icons/bi";
import { Link } from "react-router-dom";
import two from "./Images/two.jfif";
import three from "./Images/4.jfif";
import four from "./Images/5.jfif";
import six from "./Images/six.jfif";
import cc from "./Images/cc.web";
const Home = () => {
  return (
    <div className="grid grid-cols-1 divide-x indent-[5%]  divide-blue-200 mx-w-[1240px] mx-auto grid gap-1 ease-in-out px-4">
      <div className="bg border-r-green-100 border-color: rgb(214 211 209)">
        <h1 className="bg bg-red-300">Dynamic pricing </h1>
        <h2 className="">
          Dynamic price optimization is the process of offering products at
          various prices that adjust according to market conditions. Pricing on
          products and services are dynamically changed based on competitive
          pricing, supply & demand, sales requirements, and conversion rates.
        </h2>
        <h3>
          so we are working the two Ethiopian company called Ubuy And Jiji.
        </h3>
        <div className="grid grid-cols-2 divide-x indent-[5%]  divide-blue-200 mx-w-[1240px] mx-auto grid gap-1 ease-in-out px-4">
          <div>
            <Link
              className="btn btn-info btn-lg bg-green-400 max-lg"
              to="/dynamic"
            >
              Ubuy
            </Link>
          </div>
          <div>
            <Link className=" bg-green-400" to="/dynamicJiji">
              Jiji
            </Link>
          </div>
        </div>
      </div>
      {}
      <div className="grid grid-cols-2">
        <div>
      <img
        src={two}
        alt="unable to display cbe logo"
        className="w-[200px] h-[200px]"
      />
       <img
        src={six}
        alt="unable to display cbe logo"
        className="w-[200px] h-[200px]"
      />
      </div>
      <div>
       <img
        src={three}
        alt="unable to display cbe logo"
        className="w-[200px] h-[200px]"
      />
      <img
        src={four}
        alt="unable to display cbe logo"
        className="w-[200px] h-[200px]"
      />
      </div>
      </div>
    </div>
  );
};
export default Home;
